import './App.css';
import React, { useEffect, useState } from 'react';

let url = 'http://api.github.com/users';

function App() {
  const [users, setUsers] = useState([]);
  const fetchData = async () => {
    try {
      const response = await fetch(url);
      const users = response.json();
      setUsers(users);
    } catch (error) {
      console.log(error);
    }
  };
  useEffect(() => {
    fetchData();
  }, []);

  return (
      <div>
        <h1>fetch users</h1>
        <ul>
          {
            users.map((user) => {
              const {id, avatar_url, html_url, login} = user;
              return (
                  <ui key={id}>
                    <img src={avatar_url}/>
                    <a href={html_url} >{login}</a>
                  </ui>
              )
            })
          }
        </ul>
      </div>
  );
}


export default App;
